import React from "react";
import "../Styles/seed.css";

export default function Btn(props) {
  const { text, className, children } = props;

  return (
    <>
      <div
        className={` ${className} h-pr-fl-ma w-a h-a  p-10px h-e c-p  b-s-b-b ns-c-f-1 c-p h-e`} Style="border: 1px solid; border-color: white;"
      >
        <div
          className="t-a-c f-f-Gilroy r-v-c c-white hover-underline-animation"
          Style="font-size: 15px; line-height: 20px;"
        >
          <a href="" className="h-e c-p r-v-c">
            {text}
            {children}
            
          </a>
        </div>
      </div>
    </>
  );
}
